import React from "react";
import {
  AppBar, Toolbar, Typography, IconButton, Menu, MenuItem, Avatar,
  Box, Card, Divider, Button, Badge, useMediaQuery
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import WalletIcon from "@mui/icons-material/AccountBalanceWallet";
import StarIcon from "@mui/icons-material/Star";
import MenuIcon from "@mui/icons-material/Menu";

const navLinks = [
  { label: "Home" },
  { label: "Masters", menu: ["Master 1", "Master 2"] },
  { label: "Order", menu: ["Place an Order", "My Cart", "My Orders"] },
  { label: "Reports", menu: ["Report 1", "Report 2"] },
  { label: "Integration Services" },
  { label: "Customer Services" },
  { label: "Learning" },
];

export default function FuelNowDashboard() {
  // Dropdown menu state
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [menuIdx, setMenuIdx] = React.useState(null);
  const handleMenuOpen = (e, idx) => { setAnchorEl(e.currentTarget); setMenuIdx(idx); };
  const handleMenuClose = () => { setAnchorEl(null); setMenuIdx(null); };
  const isSm = useMediaQuery('(max-width:900px)');

  return (
    <Box sx={{
      bgcolor: "#fff5f7",
      minHeight: "100vh",
      width: "100vw",
      overflow: "hidden",
      fontFamily: "Inter, Arial, sans-serif"
    }}>
      {/* Top Navbar */}
      <AppBar position="static" sx={{ bgcolor: "#e23744", boxShadow: 0 }}>
        <Toolbar sx={{
          minHeight: 62,
          px: { xs: "2vw", md: "4vw" },
          justifyContent: "space-between",
        }}>
          {/* Branding */}
          <Typography variant="h6" fontWeight={900} sx={{
            mr: 6, fontSize: 30, letterSpacing: 2, color: "#fff"
          }}>
            FUELnow
          </Typography>
          {/* Desktop Nav */}
          <Box sx={{
            display: { xs: "none", md: "flex" },
            gap: 3,
            flexBasis: "50%"
          }}>
            {navLinks.map((item, idx) => (
              <Box key={item.label}>
                {item.menu ? (
                  <>
                    <Button
                      sx={{ color: "#fff", fontWeight: 700, textTransform: "none", fontSize: 17 }}
                      onClick={e => handleMenuOpen(e, idx)}
                    >
                      {item.label}
                    </Button>
                    <Menu
                      anchorEl={anchorEl}
                      open={menuIdx === idx}
                      onClose={handleMenuClose}
                      MenuListProps={{ dense: true }}
                    >
                      {item.menu.map(sub => (
                        <MenuItem key={sub} onClick={handleMenuClose}>{sub}</MenuItem>
                      ))}
                    </Menu>
                  </>
                ) : (
                  <Button
                    sx={{ color: "#fff", fontWeight: 700, textTransform: "none", fontSize: 17 }}
                  >
                    {item.label}
                  </Button>
                )}
              </Box>
            ))}
          </Box>
          {/* Profile section */}
          <Box sx={{ display: "flex", alignItems: "center" }}>
            <IconButton size="large" sx={{ color: "#fff" }}>
              <Badge badgeContent={0} color="error">
                <ShoppingCartIcon sx={{ fontSize: 28 }} />
              </Badge>
            </IconButton>
            <Typography sx={{ color: "#fff", fontWeight: 700, fontSize: 18, mr: 2 }}>
              Hello, User
            </Typography>
            <Avatar
              sx={{
                width: 42, height: 42,
                bgcolor: "#fff", color: "#e23744",
                fontWeight: 900, fontSize: 18
              }}
            >U</Avatar>
          </Box>
        </Toolbar>
      </AppBar>
      {/* Dashboard Metric Cards */}
      <Box sx={{
        display: { xs: "block", md: "flex" },
        gap: 4,
        px: { xs: "2vw", md: "6vw" },
        pt: 5,
        pb: 1,
        alignItems: "stretch",
        justifyContent: "flex-start",
      }}>
        {/* Loyalty */}
        <Card sx={{
          p: 3,
          borderRadius: 3,
          minWidth: 270,
          maxWidth: 350,
          boxShadow: 4,
          bgcolor: "#fff",
          flex: 1,
          mr: { md: 4 },
          mb: { xs: 3, md: 0 }
        }}>
          <Box sx={{ display: "flex", alignItems: "center", mb: 1 }}>
            <StarIcon sx={{ color: "#e23744", fontSize: 40, mr: 2 }} />
            <Box>
              <Typography fontWeight={700} sx={{ color: "#e23744", fontSize: 18 }}>
                Available Loyalty
              </Typography>
              <Typography variant="h5" fontWeight={900}>₹0</Typography>
            </Box>
          </Box>
          <Typography variant="body2" sx={{ opacity: .7, ml: 5 }}>
            Blocked (In Cart, Payment Initiated)
          </Typography>
        </Card>
        {/* Wallet */}
        <Card sx={{
          p: 3,
          borderRadius: 3,
          minWidth: 270,
          maxWidth: 350,
          boxShadow: 4,
          bgcolor: "#fff",
          flex: 1,
          mr: { md: 4 },
          mb: { xs: 3, md: 0 }
        }}>
          <Box sx={{ display: "flex", alignItems: "center", mb: 1 }}>
            <WalletIcon sx={{ color: "#e23744", fontSize: 40, mr: 2 }} />
            <Box>
              <Typography fontWeight={700} sx={{ color: "#e23744", fontSize: 18 }}>
                My Wallet Limit
              </Typography>
              <Typography variant="h5" fontWeight={900}>₹0</Typography>
            </Box>
          </Box>
          <Button size="small" variant="contained" disableElevation
            sx={{
              bgcolor: "#e23744",
              color: "#fff",
              mt: 1,
              borderRadius: 7,
              px: 3,
              fontWeight: 700,
              fontSize: 14,
              lineHeight: 1
            }}>
            Status Active
          </Button>
        </Card>
        {/* Cart */}
        <Card sx={{
          p: 3,
          borderRadius: 3,
          minWidth: 270,
          maxWidth: 350,
          boxShadow: 4,
          bgcolor: "#fff",
          flex: 1,
        }}>
